import React, { Component, Route, Router } from "react";
import logo from "../img/logook.jpg";
import HirdetesekComponent from "./HirdetesekComponent";
import { NavLink } from "react-router-dom";
import { useHistory } from "react-router-dom";

function NavigationDemo() {
  const history = useHistory();
  const navigateTo = () => history.push("/hirdetesek"); //eg.history.push('/login');
}
class Header extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="header-container">
        <div className="header-row">
          <div id="logo">
            <img src={logo} alt="logo" className="header-pic" />
          </div>

          <div id="menu">
            <nav id="navbar">
              <ul className="menu-items">
                <li>Kezdolap</li>
                <li className="scrollmenu">Fajtaleirasok</li>
                <li>
                  <a onClick={navigateTo}>Hirdetesek</a>
                </li>
                <li>Rolunk</li>
                <li>Kapcsolat</li>
              </ul>
            </nav>
          </div>
          <div id="right-navbar">
            <i className="fa fa-bars" aria-hidden="true"></i>
            <i className="fa fa-user" aria-hidden="true" id="userIcon"></i>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
